import React from 'react'
import { makeStyles } from '@material-ui/styles'

import ThemeToggler from './themeToggler'
import TwoFace from './twoFace'
import follower from './follower'

const useStyles = makeStyles( theme => ({
  twoFace: {
    display: 'flex',
    justifyContent: 'center',
    marginTop: '2rem'
  }
}))

export default function BenWeber (props) {
  const classes = useStyles(props.theme)

  return (
    <>
      <ThemeToggler toggleMode={props.toggleMode} />

      <TwoFace className={classes.twoFace} />

      <h1 style={{color: '#fff', fontSize: '3rem', textAlign: 'center'}}>Hey, I'm Ben Weber</h1>
      <P5Wrapper sketch={follower} />


      {/* TODO: create Text component like Typography */}
    </>
  )
}
